import React, { useState } from "react";
import useStyles from "../Form/styles.js";
import { TextField, Button, Typography, Paper } from "@material-ui/core";
const Form = () => {
  const classes = useStyles();
  const handleSubmit = () => {};
  const [postData, setPostData] = useState({
    creator: "",
    title: "",
    message: "",
    tags: "",
    selectedFile: "",
  });
  return (
    <>
      <Paper className={classes.paper}>
        <form
          autoComplete="off"
          className={classes.form}
          noValidate
          onSubmit={handleSubmit}
        >
          <Typography variant="h6">Creating a Memories</Typography>
          {/* TextField */}
          <TextField
            name="creator"
            variant="outlined"
            label="Creator"
            fullWidth
            value={postData.creator}
            onChange={(e) =>
              setPostData({ ...postData, creator: e.target.value })
            }
          />
          <TextField
            name="title"
            variant="outlined"
            label="Title"
            fullWidth
            value={postData.creator}
            onChange={(e) =>
              setPostData({ ...postData, creator: e.target.value })
            }
          />
          <TextField
            name="message"
            variant="outlined"
            label="message"
            fullWidth
            value={postData.creator}
            onChange={(e) =>
              setPostData({ ...postData, creator: e.target.value })
            }
          />
          <TextField
            name="tags"
            variant="outlined"
            label="tags"
            fullWidth
            value={postData.creator}
            onChange={(e) =>
              setPostData({ ...postData, creator: e.target.value })
            }
          />
        </form>
      </Paper>
    </>
  );
};

export default Form;
